  "title": "Nose Ring VARIETY Cartilage 28 gauge GOLD or SILVER 14k Yellow White Pink Rose Solid / Gold gf Hoop Earring Helix Tragus Septum Lip Eyebrow",
  "description": "Our beautiful shiny handmade Nose Ring can also be used as a cuff and is available in 14k gold filled, 14k gold or Sterling Silver. Choose between many different colors of gold: Yellow, White, and Pink Rose Gold. This nose ring is comfortable, lightweight, and made from 28 gauge (see below for specific varieties of colors) gold, gold filled, or silver and can be ordered in different sizes - ranging from approximately 6mm to 9mm in diameter across (please message us before purchasing if you&#39;d like it larger). Most people request 8mm. Our Yellow Gold color is shown in the photos above. This ring can be used in any piercing where the diameter is appropriate, including earlobes, nose, cartilage, tragus, helix, lip, septum, eyebrow, etc.\r\n\r\nPlease note that 28 gauge is very thin, and tends to be quite delicate. While it is not the thinnest nose ring we sell, and it is forged to add strength, it is advised to treat it with care. \r\n\r\n______________\r\nIf you are looking for an even THINNER nose ring, check out our 30 GAUGE nose hoops! They are the most delicate rings available! \r\n\r\nhttps://www.etsy.com/listing/166356507/nose-ring-variety-cartilage-30-gauge-30g\r\n\r\n________________\r\nLooking for something a bit THICKER? Try our 26 GAUGE! \r\n\r\nhttps://www.etsy.com/listing/162910842/nose-ring-variety-cartilage-26-gauge-26g\r\n\r\n____________________________________\r\nWe offer the following types of precious metal:\r\n\r\n- 14k Solid Yellow Gold \r\n- 14k Solid White Gold\r\n- 14k Solid Pink Gold\r\n\r\n- 24k Solid Yellow Gold\r\n\r\n- 14k Yellow Gold Filled\r\n- 14k White Gold Filled\r\n- 14k Pink Gold Filled\r\n\r\n- Fine Silver .999\r\n\r\n- Sterling Silver\r\n\r\n\r\n\r\nNEED A DIFFERENT GAUGE / METAL / HOOP DIAMETER? Please let us know! We can custom make:\r\n\r\nGauge: 14, 16, 18, 20, 22, 24, 26, 28, 30\r\n- 14k Yellow Gold  Filled\r\n- 14k Rose Gold Filled\r\n- 14k White Gold  Filled (also available in 19 & 21 ga)\r\n- Sterling  Silver\r\n- Fine Silver .999\r\n- 14k, 22k, 24k Solid Yellow  Gold\r\n- 14k Solid Rose Gold\r\n- 14k Solid White Gold\r\n- 14k Solid Palladium White Gold\r\n- Platinum\r\n- 22k Solid Yellow Gold\r\n- 24k Solid Yellow Gold\r\n\r\nOur items are American made and shipped from America. When you buy from us, you are receiving jewelry handcrafted by a professionally trained artist living in the United States, and NOT mass produced foreign goods. Feel free to message us with any questions and make sure you check out our other listings for more great jewelry!\r\n\r\nPlease keep in mind that monitors vary in size and color, so item color or size may vary slightly from picture. Diameter measurement is an approximation, and can vary a slight bit. Our items are made by hand, so we strive to make our listing accurate and realistic. These are just standard things that apply to most listings on Etsy, be we like to mention them. While most items have the same handling time as listed, some items may have longer handling time than listed due to the need to special order materials. Please inquire about handling time before purchasing if receiving your item quickly is very important to you.",
